def movement(agent_pos, prey_pos, pred_pos):
    poss_moves = {}
    poss_moves[agent_pos] = weighted_utility(agent_pos, prey_pos, pred_pos)
    for neighbour in c.GRAPH[agent_pos] + [agent_pos]:
        poss_moves[neighbour] = c.U_star[(neighbour, prey_pos, pred_pos)]
    
    best_move = min(poss_moves, key=poss_moves.get)
    c.STEPS += 1
    return best_move

def activation_function(x):
    return 1 / (1 + np.exp(-x))


def weighted_utility(agent, prey, pred):
    if (agent, prey, pred) in lookup_table:
        return infinity
    else:
        input = [c.FULL_DIST[agent][prey], c.FULL_DIST[agent][pred], c.FULL_DIST[prey][pred]]
        input_layer = np.dot(input, weight1)
        l2 = activation_function(input_layer)
        l3 = np.dot(l2, weight12)
        l4 = activation_function(l3)
        l5 = np.dot(l4, weight23)
        l6 = activation_function(l5)
        l7 = np.dot(l6, weight34)
        l8 = activation_function(l7)
        l9 = np.dot(l8, weight4)
        output = activation_function(l9)
        return output * 3

